  [],\n\t\"revision_timestamp\": \"2015-05-07T01:31:16.292197\",\n\t\"name\": \"distributed-visualization-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"As the teams supporting NASA missions become
  increasingly diverse and dispersed new means of sharing data and experiences among
  team members are required. Collaboration must occur across teams in different geographic
  locations, different time zones and, in the case of missions on the distant horizon,
  different generations. Each of these teams has different expertise and uses different
  tools to meet their goals, yet they must all somehow come together to achieve a
  single vision. Distributed Visualization strives to unify teams and technologies
  by providing a common mechanism for sharing and integrating pertinent data.  To
  accomplish this task, algorithms, software, data formats, data systems, and process
  are examined to identify and implement those which will best enable the sharing
  and integration of simulation-based information across temporal and spatial boundaries.nnTo
  date, demonstrated work in Distributed Visualization has dealt with physics-based
  simulations and utilized a variety of graphics engines and toolkits. In addition
  to the application of these technologies, significant effort has been expended to
  define data elements, identify process commonality among simulation teams, establish
  interfaces, and evolve data standards. This approach has resulted in a tool agnostic
  capability that relies on simple inputs and requires virtually no knowledge of how
  the data was generated, which allows collaboration without sharing source algorithms
  and system properties.  Validation has been performed using simulation results from
  Glenn, JPL, JSC, KSC and Langley, generated in everything from Dassault?s Delmia
  to Google Sketchup.nResearch areas for further enhancement include: use of data
  from other types of simulators (ex. Computational Fluid Dynamics, Discrete Event
  Simulation, Distributed Simulation), local storage vs. centralized storage, system
  latency and other network-induced challenges, and human-computer interaction.n \",\n\t\"license_title\":
